We must have $a^2 \leq a$, so $a \leq 1$.  If $a=1$, then $f(x) = x^2$ for $x \geq 1$ and $f(x) = x+2$ for $x < 1$.  The graph of $y=f(x)$ is shown below:

[asy]
Label f;

f.p=fontsize(6);

xaxis(-2,3,Ticks(f, 1.0));

yaxis(-1,4,Ticks(f, 1.0));

real f(real x)

{

return x^2;

}

draw((-1,-1)--(1,3),Arrows);

draw((-2,4)--(2,4),Arrows);

label("$y=f(x)$",(2,4),E);

label("$x$",(3,0),S);

label("$y=x^2$",(1,3),E);

label("$y=x+2$",(1,3),W);

[/asy]

Thus, $a$ can be any number less than or equal to 1.  If $a=1$, then $y=f(x)$ intersects the $x$-axis at $x=-2$ and $x=0$.  If $a<1$, then $y=f(x)$ intersects the $x$-axis at $x=-2$ and $x=\sqrt{a}$.  Thus, $a$ can be any number less than or equal to 1, and $y=f(x)$ intersects the $x$-axis at least once.  Therefore, the largest possible value of $a$ is $\boxed{1}$.

Let the six vertices of the octagon be $A,$ $B,$ $C,$ $D,$ $E,$ and $F,$ in that order.  Let $x$ be the distance from $P$ to $F.$

[asy]
import three;

size(125);
currentprojection = perspective(6,3,1);

triple A, B, C, D, E, F, P;

A = (1,0,0);
B = (-1,0,0);
C = (0,1,0);
D = (0,-1,0);
E = (0,0,1);
F = (0,0,-1);
P = (1.2,1.5,1);

draw(A--P,red);
draw(B--P,red);
draw(C--P,red);
draw(D--P,red);
draw(E--P,red);
draw(F--P,red);

draw(A--C);
draw(A--D);
draw(A--E);
draw(A--F);
draw(C--E--D--F--cycle);
draw(D--B--C,dashed);
draw(B--C,dashed);
draw(B--D,dashed);
draw(B--E,dashed);
draw(B--F,dashed);

label("$P$", P, NE);
label("$x$", (0,-1.5,0), S);
label("$3$", (A + P)/2, N);
label("$7$", (B + P)/2, N);
label("$8$", (C + P)/2, N);
label("$9$", (D + P)/2, N);
label("$11$", (E + P)/2, N);
label("$y$", (F + P)/2, N);
[/asy]

By the Law of Cosines on triangle $APF,$
\[x^2 + 1 - 2x \cos \theta = 9.\]By the Law of Cosines on triangle $FPB,$
\[x^2 + 1 - 2x \cos (180^\circ - \theta) = 11.\]Adding these equations, we get
\[2x^2 + 2 = 20,\]so $x^2 = 9,$ and $x = 3$ or $x = -3.$  Since $x$ is a distance, $x = \boxed{3}.$

We can set up the following equations: \begin{align*}
n-3+3+n+1&=n+2+2n-9+1\\
\Rightarrow\qquad 2n+1&=3n-7\\
\Rightarrow\qquad 8&=n
\end{align*}
